import React from 'react';
import styled from 'styled-components';


const ScoreStyled = styled.div`

background: white; 
text-align: center;
padding: 10px 0;
border
small{
    color: #2A45C2;
   
}
p{
    color: #565468;
}


`

export default function Score() {
    return (
        <ScoreStyled>
       
       <small>Score</small>
         <p>  12  </p>  
     
           
        </ScoreStyled>
    )
}
